// import { useState } from "react";
// import { useEffect } from "react";
// import GetUsersItem from "./components/GetUsersItem";
// import { TEST_URL } from './MAIN.js';

function UsersList() {
    const [error, setError] = useState(null);
    const [isLoaded, setIsLoaded] = useState(false);
    const [GettedUsers, setGettedUsers] = useState([]);

    const [userItems, setUserItems] = useState(GettedUsers)

    function GetUsers() {

        useEffect(() => {
            fetch(TEST_URL)
                .then(response => response.json())
                .then(
                    (result) => {
                        setIsLoaded(true);
                        setUserItems(result);
                    },
                    // Примечание: важно обрабатывать ошибки именно здесь, а не в блоке catch(),
                    // чтобы не перехватывать исключения из ошибок в самих компонентах.
                    (error) => {
                        setIsLoaded(true);
                        setError(error);
                    }
                )
        }, [])
        return GettedUsers;
    }
    GetUsers();

    return (
        <div className="App">
            <header className="header flex">
                <div className="conteiner header_conteiner flex">
                    <div className="header_mem_text">
                        <h1>Logo</h1>
                    </div>
                    <div className="authentication flex">
                        <a href="login.html" className="home_page_link header_link flex">
                            <span>Вход</span>
                        </a>
                        <a href="registration.html" className="home_page_link header_link flex">
                            <span>Регистрация</span>
                        </a>
                    </div>
                </div>
            </header>
            <main className="main">
                <div className="container home_page_container">
                    {userItems.map(item =>
                        <GetUsersItem item={item} key={item.id} />
                    )}
                </div>
            </main>
            <footer className="footer">

            </footer>
        </div>
    )
}

export default UsersList;
